import React from "react";
import FormatColorFillIcon from "@mui/icons-material/FormatColorFill";

const PaintBucket = () => {
  return (
    <div style={{ display: "grid", justifyContent: "center" }}>
      <FormatColorFillIcon />
    </div>
  );
};

export default PaintBucket;
